ercentage change from an arbitrary pre-pandemic baseline\n            of rates of visitation to residential addresses.\n            Consequently, it also captures a sense of the rate at which people remain at home.\n            &lt;/i&gt;","google_retail_and_recreation":"&lt;i&gt;\n            This dataset, derived from\n            &lt;a href=\"https://www.google.com/covid19/mobility/\"&gt;Google mobility data&lt;/a&gt;,\n            shows the percentage change from an arbitrary pre-pandemic baseline\n            of rates of visitation to retail and recreation venues.\n            &lt;/i&gt;","google_transit_stations":"&lt;i&gt;\n            This dataset, derived from\n            &lt;a href=\"https://www.google.com/covid19/mobility/\"&gt;Google mobility data&lt;/a&gt;,\n            shows the percentage change from an arbitrary pre-pandemic baseline\n            of rates of visitation to public transport stations.\n            &lt;/i&gt;","google_workplaces":"&lt;i&gt;\n            This dataset, derived from\n            &lt;a href=\"https://www.google.com/covid19/mobility/\"&gt;Google mobility data&lt;/a&gt;,\n            shows the percentage change from an arbitrary pre-pandemic baseline\n            of rates of visitation to offices and other workplaces.\n            &lt;/i&gt;","immunity":"&lt;i&gt;\n            This dataset, derived from vaccination and case data,\n            gives an estimate of the proportion of all persons in a given area\n            who have some form of immunity from COVID as of a given date.\n            &lt;/i&gt;","vax_first_proportion":"&lt;i&gt;\n            This dataset, derived from government sources,\n            combines true data with forward modelling to show or predict\n            the proportion of all people in a given area\n            who (will) have received their first vaccine dose as of a given date.\n            &lt;/i&gt;","vax_second_proportion":"&lt;i&gt;\n            This dataset, derived from government sources,\n            combines true data with forward modelling to show or predict\n            the proportion of all people in a given area\n            who (will) have received their first vaccine dose as of a given date.\n            &lt;/i&gt;","vulnerability":"&lt;i&gt;\n            This dataset, derived from vaccination and case data,\n            estimates the chance that a person in a given area on a given date\n            will fall seriously ill if infected with COVID.\n            &lt;/i&gt;"},"y_range":{"id":"1837"}},"code":"\n            lineSource.data = lineSources[select.value].data\n            lineSource.name = select.value\n            lineSource.change.emit()\n            span.location = slider.value\n            span.change.emit()\n            y_range.setv({'start': mins[select.value], 'end': maxs[select.value]})\n            varNote.text = varNotes[select.value]\n            varNote.change.emit()\n            const barChoice = select.value + '_' + slider.value\n            barSource.data = barSources[barChoice].data\n            barSource.name = select.value.toString() + ', ' + slider.value.toString()\n            barSource.change.emit()\n            for (let i = 0; i &lt; lines.length; i++){\n                let checked = checkboxes.active.includes(i)\n                lines[i].muted = !(checked)\n                bars[i].muted = !(checked)\n                var alpha = checked ? 1 : 0;\n                patches[i].glyph.fill_alpha = alpha\n            }\n            const newCol = select.value + '_' + slider.value\n            for (let i = 0; i &lt; lines.length; i++){\n                patches[i].glyph.fill_color['field'] = newCol\n                patches[i].name = newCol\n            }\n            mapColourMapper.low = mins[select.value]\n            mapColourMapper.high = maxs[select.value]\n            geoSource.change.emit()\n            "},"id":"2661","type":"CustomJS"},{"attributes":{},"id":"3639","type":"UnionRenderers"},{"attributes":{},"id":"3
